function switchSymbol(symbol, update) {
    this.symbol = symbol
    if (timer) {
        clearTimeout(timer)
        timer = setInterval(() => {
            if (this.requestFlag) {
                switchSymbol(symbol, 'update')
            } else {
                // console.log('wait...')
            }
        }, 10000);
    }


    if (update == undefined) {
        console.log("undefine")
        update = 'refresh'
    }
    console.log("切换币种:", symbol)

    for (var i = 0; i < 8; i++) {
        switch (i) {
            case 0:
                sendRequest(symbol, '1min', update)
                break;
            case 1:
                sendRequest(symbol, '3min', update)
                break;
            case 2:
                sendRequest(symbol, '5min', update)
                break;
            case 3:
                sendRequest(symbol, '15min', update)
                break;
            case 4:
                sendRequest(symbol, '30min', update)
                break;
            case 5:
                sendRequest(symbol, '60min', update)
                break;
            case 6:
                sendRequest(symbol, '4hour', update)
                break;
            case 7:
                sendRequest(symbol, '1day', update)
                break;
        }
    }


}

function sendRequest(symbol, kxType, update) {
    let that = this;
    that.requestFlag = false;
    $.ajax({
        url: '/api/stock_data',
        data: {'symbol': symbol, 'period': kxType},
        type: 'get',
        success: function (data) {
            that.requestFlag = true;
            // $(".loading-style-4").hide();
            that.symbol = symbol;
            // var result = draw(data, 'refresh', kxType);
            var result = draw(data, update, kxType);
            // 如果请求的symbol 和kxType 不一致 ,直接return
        },
        error: function (error) {
            that.requestFlag = true;
            // $(".loading-style-4").hide();

        }
    });
}

